static char          *adbmeta_filename;
static uint64_t       adbmeta_filesize;
static char          *adbmeta_SIG;
static unsigned char *adbmeta_data;
static uint32_t       adbmeta_datasize;

void adbMetaClear(void)
{
	free (adbmeta_filename);
	free (adbmeta_SIG);
	free (adbmeta_data);
	adbmeta_filename = 0;
	adbmeta_filesize = 0;
	adbmeta_SIG = 0;
	adbmeta_data = 0;
	adbmeta_datasize = 0;
}

int adbMetaAdd (const char *filename, const uint64_t filesize, const char *SIG, const unsigned char  *data, const uint32_t  datasize)
{
	adbMetaClear ();
	adbmeta_filename = strdup (filename);
	adbmeta_filesize = filesize;
	adbmeta_SIG = strdup (SIG);
	adbmeta_data = malloc (datasize);
	memcpy (adbmeta_data, data, datasize);
	adbmeta_datasize = datasize;

	return 0;
}

int adbMetaGet (const char *filename, const uint64_t filesize, const char *SIG,       unsigned char **data,       uint32_t *datasize)
{
	if (!adbmeta_filename)
	{
		return -1;
	}
	if ((!strcmp (filename, adbmeta_filename)) && (filesize == adbmeta_filesize))
	{
		*data = malloc (adbmeta_filesize);
		memcpy (*data, adbmeta_data, adbmeta_datasize);
		*datasize = adbmeta_datasize;
		return 0;
	}
	return -1;
}

